DROP TABLE IF EXISTS `comment`;
CREATE TABLE `comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '评论ID',
  `theme` varchar(30) NOT NULL COMMENT '主题',
  `author` varchar(25) NOT NULL COMMENT '作者',
  `content` varchar(255) NOT NULL COMMENT '内容',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '发表时间',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品ID',
  `anonymity` char(1) NOT NULL COMMENT '匿名与否',
  `comment_id` int(11) DEFAULT NULL COMMENT '回复ID',
  `order_id` int(11) DEFAULT NULL COMMENT '订单id',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `comment_id` (`comment_id`),
  KEY `author` (`author`),
  KEY `comment_ibfk_4` (`order_id`),
  CONSTRAINT `comment_ibfk_1` FOREIGN KEY (`goods_id`) REFERENCES `goods` (`id`) ON DELETE CASCADE,
  CONSTRAINT `comment_ibfk_2` FOREIGN KEY (`comment_id`) REFERENCES `comment` (`id`) ON DELETE CASCADE,
  CONSTRAINT `comment_ibfk_3` FOREIGN KEY (`author`) REFERENCES `user_info` (`username`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `comment_ibfk_4` FOREIGN KEY (`order_id`) REFERENCES `order` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

